  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Rainwater Basin Wetland Management District for
  the next 15 years. This plan outlines the District vision and purpose and describes
  how Rainwater Basin Wetland Management District will contribute to the overall mission
  of the Refuge System. The plan provides an introduction to the District, an overview
  of the CCP process, information about the management direction, and a description
  of the affected environment. Key planning issues include: wetlands, uplands, water
  rights, invasive plants, wildlife diseases, cultural resources, visitor services,
  partnerships, socioeconomics, and operations.\",\n\t\"license_title\": \"License
